<html>

<head>
	<meta charset="UTF-8">
	<title>Screenshot example</title>
	<link rel="stylesheet" type="text/css" href="style.css">
	<script src="logger.js"></script>
	<script type="text/javascript">
		/************************************************************************/
		/*************** Here is the Test Suite you should modify ***************/
		/************************************************************************/
		(function () {
			window.onload = function () {
				var testRunner = new window.ScreenshotTestRunner("example.screenshot");
				// Root file system for captures is http://ip_player/.output/@your_path where @your_path is the first argument of "testCaptureObject" function
				testRunner.testCaptureObject("any_folder/hub.ppk", "image/g4");
				testRunner.testCaptureObject("any_folder/window.jpg", "image/jpeg");
			};
		})();
		/************************************************************************/
		/*************** From here don't need to modify anything ****************/
		/************************************************************************/

		(function () {
			function ScreenshotTestRunner(name) {
				this._logger = new window.Logger(name);
				this._logger.log("ScreenshotTestRunner");
			}
			ScreenshotTestRunner.prototype = {
				testCaptureObject: function (outputDirPath, imageType) {
					try {
						this._logger.log("*************** testCaptureObject ***************");
						var screenshot = new Screenshot();
						this._logger.log("You can check the generated picture file on your player: http://<player_ip>/.output/" + outputDirPath);
						screenshot.captureObject(window, outputDirPath, imageType, 0);
						this._logger.log("Screenshot succeeded");
					} catch (error) {
						this._logger.errorEx(error);
					}
				},
			};
			window.ScreenshotTestRunner = ScreenshotTestRunner;
		})();

	</script>

		body {
			height: 600px;
			width: 800px;
			margin: 0;
